import React from "react";
import ReactDOM from "react-dom";
import Navbar from "./NavBar";
import HomePage from "./HomePage";

function EditPage() {
    return (
        <div>
            <Navbar></Navbar>
            <center>
            <div class="form-floating mb-3">
                <input type="textarea" style={{margin: 10}} class="form-control" id="floatingInput" step="any" placeholder="name@example.com"/>
            </div>
            <div class="form-floating">
                <input type="textarea" style={{width: "50px"}} class="form-control" step="any" id="floatingPassword" placeholder="Password"/>
            </div>
            </center>
        </div>
    );
}

export default EditPage;
